function calculAngle(valx, valy) {
  const vallsb = 1;
  const valxGauss = valx * vallsb;
  const valyGauss = valy * vallsb;
  let angle = 0;

  if (valxGauss != 0) {
    angle = Math.atan(valyGauss / valxGauss) * (180 / Math.PI);
  } else {
    if (valyGauss < 0) {
      angle = 90;
    } else {
      angle = 0;
    }
  }

  if (angle > 360) {
    angle = angle - 360;
  } else if (angle < 0) {
    angle = angle + 360;
  }

  return angle;
}

